CKEDITOR.plugins.setLang("a11yhelp","oc",{title:"Instruccions d'accessibilitat",contents:"Contengut de l'ajuda. Per tampar aquesta fen\xe8stra, quichatz sus la t\xf2ca Escap.",legend:[{name:"General",items:[{name:"Barra d'aisinas de l'editor",legend:"Quichar sus ${toolbarFocus} per accedir a la barra d'aisinas. Se despla\xe7ar cap al groupe seguent o precedent de la barra d'aisinas amb las t\xf2cas Tab e Maj+Tab. Se despla\xe7ar cap al boton seguent o precedent de la barra d'aisinas amb las t\xf2cas Sageta dreita e Sageta esqu\xe8rra. Quichar sus la barra d'espaci o la t\xf2ca Entrada per activer lo boton de barra d'aisinas."},{name:"Fen\xe8stra de l'editor",legend:"Dins una b\xf3stia de dial\xf2g, quichar sus Tab per passar a l'element seguent, quichar sus Maj+Tab per passar a l'element precedent, quichar sus Entrada per validar, quichar sus Escap per anullar. Quand una b\xf3stia de dial\xf2g possed\xeds des onglets, la lista p\xf2t \xe8sser atenta amb Alt+F10 o amb Tab. Dins la lista dels onglets, se despla\xe7ar cap al seguent e lo precedent amb las t\xf2cas Sageta dreita e Sageta esqu\xe8rra respectivament."},{name:"Men\xfa contextual de l'editor",legend:"Quichar sus ${contextMenu} o sus la t\xf2ca Men\xfa per dobrir lo men\xfa contextual. Se despla\xe7ar ensuite cap a l'opcion seguenta del men\xfa amb las t\xf2cas Tab o Sageta bas. Se despla\xe7ar cap a l'opcion precedenta amb las t\xf2cas Maj+Tab o Sageta naut. Quichar sus la barra d'espaci o la t\xf2ca Entrada per seleccionar l'opcion del menu. Quichar sus la barra d'espaci, la t\xf2ca Entrada o Sageta dreita per dobrir lo sosmen\xfa de l'opcion seleccionada. Tornar a l'element de men\xfa parent amb la t\xf2ca Escap o Sageta esqu\xe8rra. Tampar lo men\xfa contextual amb Escap."},{name:"Z\xf2na de lista de l'editor",legend:"Dins una lista en men\xfa desenrotlant, se despla\xe7ar cap a l'element seguent de la lista amb las t\xf2cas Tab o Sageta bas. Se despla\xe7ar cap a l'element precedent de la lista amb las t\xf2cas Maj+Tab o Sageta naut. Quichar sus la barra d'espaci o sus Entrada per seleccionar l'opcion dins la lista. Quichar sus Escap per tampar lo men\xfa desenrotlant."},{name:"Barra del camin d'elements de l'editor",legend:"Quichar sus ${elementsPathFocus} per naviguer cap a la barra del fial d'Ariana dels elements. Se despla\xe7ar cap al boton de l'element seguent amb las t\xf2cas Tab o Sageta dreita. Se despla\xe7ar cap al boton precedent amb las t\xf2cas Maj+Tab o Sageta esqu\xe8rra. Quichar sus la barra d'espaci o sus Entrada per seleccionar l'element dins l'editor."}]},{name:"Comandas",items:[{name:"Anullar la comanda",legend:"Quichar sus ${undo}"},{name:"Comanda restablir",legend:"Quichar sus ${redo}"},{name:" Comanda gras",legend:"Quichar sus ${bold}"},{name:" Comanda italica",legend:"Quichar sus ${italic}"},{name:" Comanda solinhat",legend:"Quichar sus ${underline}"},{name:" Comanda ligam",legend:"Quichar sus ${link}"},{name:"Comanda enrotlar la barra d'aisinas",legend:"Quichar sus ${toolbarCollapse}"},{name:"Comanda d'acc\xe8s a l'element seleccionable precedent",legend:"Quichar sus ${accessNextSpace} per accedir a l'element seleccionable inategnible lo mai pr\xf2che abans lo cursor, per exemple\xa0: doas linhas orizontalas adjacentas. Repetir la combinason de t\xf2cas per at\xe9nher los elements seleccionables precedents."},{name:"Comanda d'acc\xe8s a l'element seleccionable seguent",legend:"Quichar sus ${accessNextSpace} per accedir a l'element seleccionable inatenhible lo mai pr\xf2che apr\xe8p lo cursor, per exemple\xa0: doas linhas orizontalas adjacentas. Repetir la combinason de t\xf2cas per at\xe9nher los elements seleccionables seguents."},{name:" Ajuda sus l'accessibilitat",legend:"Quichar sus ${a11yHelp}"},{name:" Paste as plain text",legend:"Press ${pastetext}",legendEdge:"Press ${pastetext}, followed by ${paste}"}]}],tab:"Tabulacion",pause:"Pausa",capslock:"Verr. Maj.",escape:"Escap",pageUp:"Pagina superiora",pageDown:"Pagina seguenta",leftArrow:"Sageta esqu\xe8rra",upArrow:"Sageta naut",rightArrow:"Sageta dreita",downArrow:"Sageta bassa",insert:"Inser",leftWindowKey:"T\xf2ca Windows esqu\xe8rra",rightWindowKey:"T\xf2ca Windows dreita",selectKey:"T\xf2ca Seleccionar",numpad0:"0 del pavat numeric",numpad1:"1 del pavat numeric",numpad2:"2 del pavat numeric",numpad3:"3 del pavat numeric",numpad4:"4 del pavat numeric",numpad5:"5 del pavat numeric",numpad6:"6 del pavat numeric",numpad7:"7 del pavat numeric",numpad8:"Pavat numeric 8",numpad9:"9 del pavat numeric",multiply:"Multiplicar",add:"Plus",subtract:"Mens",decimalPoint:"Punt decimal",divide:"Devesir",f1:"F1",f2:"F2",f3:"F3",f4:"F4",f5:"F5",f6:"F6",f7:"F7",f8:"F8",f9:"F9",f10:"F10",f11:"F11",f12:"F12",numLock:"Verr. Num.",scrollLock:"Arr\xe8st desfil.",semiColon:"Punt-virgula",equalSign:"Signe egal",comma:"Virgula",dash:"Jonhent",period:"Punt",forwardSlash:"Barra oblica",graveAccent:"Accent gr\xe8u",openBracket:"Parent\xe8si dob\xe8rta",backSlash:"Barra oblica inv\xe8rsa",closeBracket:"Parent\xe8si tampanta",singleQuote:"Apostr\xf2fa"});